CREATE TABLE `country_name` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `country_id` int(11) unsigned NOT NULL,
  `code2l` varchar(2) NOT NULL DEFAULT '' COMMENT 'ISO 2-letter code',
  `language` varchar(5) NOT NULL DEFAULT '' COMMENT 'Language code (ie. pt-pt)',
  `name` varchar(255) DEFAULT NULL,
  `name_official` varchar(255) DEFAULT NULL,
  `source` varchar(255) DEFAULT NULL COMMENT 'Data source',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNIQUE_code2l_language` (`code2l`,`language`),
  KEY `fk_country_name__country_idx` (`code2l`),
  KEY `fk_country_name_country_idx` (`country_id`),
  CONSTRAINT `fk_country_name__country` FOREIGN KEY (`country_id`) REFERENCES `country` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1394 DEFAULT CHARSET=utf8;
